import React, { Component } from 'react';
import { Button, Typography } from '@material-ui/core';
import Dropdown from 'muicss/lib/react/dropdown';
import DropdownItem from 'muicss/lib/react/dropdown-item';
import './navbar.css';
import $ from 'jquery'

class Navbar extends Component {
  navigateTo(page) {
    window.location.href = page;
  }

  toggleDropdown(dropdownID) {
    document.getElementById(dropdownID).children[0].click();
  }

  createDropdown(props) {
    let { id, label, links, linkLabels } = props;
    return (
      <Dropdown
        id={id}
        onMouseEnter={() => this.toggleDropdown(id)}
        onMouseLeave={() => this.toggleDropdown(id)}
        color="inherit" style={{display:'inline', borderWidth:'0px'}} label={label} className="MuiButtonBase-root MuiButton-root MuiButton-text MuiButton-colorInherit">
        <DropdownItem style={{backgroundColor:'indianred'}} link="links.html">My Links</DropdownItem>
        <DropdownItem style={{backgroundColor:'indianred'}} link="links.html">BLM Links</DropdownItem>
      </Dropdown>
    )
  }

  // if i get desperate and want to use bootstrap: https://stackoverflow.com/questions/43493678/react-bootstrap-import-navbar-module

  render() {
    let linksUL = (
      <ul className="mui-dropdown__menu mui--is-open" style={{top: '39.5px'}}>
        <li style={{backgroundColor: 'indianred'}}><a href="links.html">My Links</a></li>
        <li style={{backgroundColor: 'indianred'}}><a href="links.html">BLM Links</a></li>
      </ul>
    );

    let linksUL2 = (
      <ul class="mui-dropdown__menu mui--is-open" style="top: 39.5px;">
        <li style="background-color: indianred;"><a href="links.html">My Links</a>
        </li><li style="background-color: indianred;"><a href="links.html">BLM Links</a></li>
      </ul>
    )
    return (
      <div id="navbar-container">
        <div id="navbar-title-container">
          <Typography id="navbar-title" variant="h2">
            NATALIE WAGNER
          </Typography>
        </div>
        <div id="navbar-buttons-container">
          <Button color="inherit" onClick={() => this.navigateTo('index.html')}
            onMouseEnter={() => console.log('enter home')}
            onMouseLeave={() => console.log('exit home')}>
            Home
          </Button>
          {/* <Button color="inherit" onClick={() => this.navigateTo('quiz.html')}>
            Quiz
          </Button> */}
          <Button color="inherit" onClick={() => this.navigateTo('links.html')}>
            My Links
          </Button>
          <Button color="inherit" onClick={() => this.navigateTo('emailnatalie.html')}>
            Email Me
          </Button>
          <Button color="inherit" className="navbar-dropdown" onClick={() => {}}
            onMouseEnter={() => {
              console.log('bish')
